const fetch = require("node-fetch");

export const getItems = () => {
  let res = fetch("http://localhost:3221/items", {
    headers: {
      Accept: "application/json",
    },
  });
  return res;
};

export const getIntent = (intent) => {
    let res = fetch(`http://localhost:3221/nlp/${intent}`, {
        headers: {
          Accept: "application/json",
        },
      });
      return res;
}
